INSERT INTO `cms` VALUES (3,'Terms_And_Conditions',0,1,'Jobs In India','Find best Jobs in india, jobs listings and job opportunities on ROZEE.PK. Browse more than 100K jobs in india and apply for free! ROZEE.PK is india\'s leading job website where more than 52K top companies are posting jobs','Jobs in India , Jobs, Careers, Recruitment, Employment, Hiring, Banking, CVs, Career, Finance, IT, Marketing, Online Jobs, Opportunity,Pakistan, Resume, Work, naukri, rizq, Rozi','<meta name=\"robots\" content=\"ALL, FOLLOW,INDEX\" />','2018-04-02 15:08:57','2023-05-27 09:50:59'),(4,'Terms_And_Conditions',1,1,'Terms & Conditions','Terms & Conditions','Terms & Conditions',NULL,'2019-01-07 10:43:22','2023-10-14 10:12:27'),(5,'Privacy_Policy',1,1,'Privacy Policy','Privacy Policy','RETURN POLCY \r\nALL SALES ARE FINAL AND NO REFUND WILL BE ISSUED\r\nQUESTIONS\r\nIF YOU HAVE ANY QUESTIONS CONCERNING OUR RETURN POLICY, PLEASE CONTACT US AT\r\n\r\n8884442935\r\n8884442936\r\nJOBDESK@EUDYOGA.COM\r\nHRDESK@EUDYOGA.COM','Privacy Policy','2023-10-14 10:05:56','2023-10-14 11:34:20'),(6,'Refund_Policy',1,1,'Refund Policy','m','Refund and Returns Policy\r\nLicensing: Once the software is purchased or a license is obtained, it is non-refundable. This means that even if the software doesnt meet your expectations or requirements, you are not eligible for a refund.\r\nDigital nature: Since the software is often delivered digitally, there is no physical product to return. Once the software is downloaded or activated, it is considered used and non-refundable.\r\nIntellectual property: Software is protected by copyright and intellectual property laws. By purchasing or using the software, you acknowledge that you are acquiring a license to use the software, not ownership of the software itself. This reinforces the non-refundable nature of software, as the intellectual property rights associated with the software remain with the developer or publisher.\r\nTrial versions or demos: Many software products offer trial versions or demos that allow users to evaluate the softwares features and functionality before making a purchase. If you choose to purchase the full version after using a trial version, the purchase is typically non-refundable.\r\nCustomization or configuration: If the software is customized or configured specifically for your needs, it may not be eligible for a refund. This is because the software has been tailored to your requirements, making it difficult for the developer or publisher to resell it to another customer.\r\nTerms and conditions: Software purchases are subject to the terms and conditions set forth by the developer or publisher. These terms often outline the non-refundable nature of the software and any specific conditions under which a refund may be considered.\r\nIts important to carefully review the terms and conditions, as well as any trial versions or demos, before purchasing software to ensure it meets your requirements and expectations.\r\nNo refund will be given if your Whatsapp account is blocked, suspended, banned, or direct-paid.\r\n\r\n\r\n\r\nNeed help?\r\nContact us at hrdesk@eudyoga.com  for questions related to refunds and returns.','Refund Policye','2023-10-14 10:11:22','2023-11-02 10:57:11');
