INSERT INTO `cms_content` VALUES (7,3,'About Us','<p>Eudyoga is the ultimate destination for your Job Search. We search for the best employers providing the best salary in the industry. Our database is a bucket of talents, skills, and jobs according to choice. We make your dreams into reality and offer what you always want. We become the challenge to the competitive world by bringing the best Employer and Employee at the same stage.<br /><br />-     .        .   ,       .         .            .<br /><br />Our candidates share the best experience with their employment. The companies are booming with the talents that we share with them. More than a billion candidates can search for their best-suited jobs from the million companies in our portal. Our experts and career consultants always try to groom our candidates with the best expert to advise.<br /><br />      .       .            .              .<br /><br />It is the brainchild of Kavya and Guruswamy. They have worked together to build their vision and thoughts. Thousand Vision World Pvt Ltd made this company incorporated on the 22nd of March 2021 as a Private limited company in Bangalore.<br /><br />     .         .        2022   21      .<br /><br />We are growing as a Rainbow with a variety of job openings for youths and professionals. We create an ultimate destinate for the Employers and Employees and help the country with more employment.<br /><br />       .             .</p>','2018-09-12 04:45:03','2023-05-15 13:47:37','en'),(8,4,'Terms & Conditions','<p>Terms of Use for Website</p>\r\n<h1>AGREEMENT TO TERMS</h1>\r\n<p></p>\r\n<p data-custom-class=\"body_text\">These Terms of Use constitute a legally binding agreement made between you, whether personally or on behalf of an entity (you) andThousand Vision World Pvt Ltd(\"<strong>Company</strong>,\" <strong>we</strong>,\" <strong>us</strong>,\" or <strong>our</strong>), concerning your access to and use of the<a href=\"http://www.eudyoga.com/\" data-custom-class=\"link\">http://www.eudyoga.com</a>website as well as any other media form, media channel, mobile website or mobile application related, linked, or otherwise connected thereto (collectively, the Site).We are registered inIndiaand have our registered office atNo 1088/1 K N Ext, Yeshwanthpur Bangalore Bangalore - 560022 Karnataka - India,Bangalore<span data-custom-class=\"body_text\">,karnataka560022</span><span data-custom-class=\"body_text\">.</span>You agree that by accessing the Site, you have read, understood, and agreed to be bound by all of these Terms of Use. IF YOU DO NOT AGREE WITH ALL OF THESE TERMS OF USE, THEN YOU ARE EXPRESSLY PROHIBITED FROM USING THE SITE AND YOU MUST DISCONTINUE USE IMMEDIATELY.</p>\r\n<p></p>\r\n<p data-custom-class=\"body_text\">Supplemental terms and conditions or documents that may be posted on the Site from time to time are hereby expressly incorporated herein by reference. We reserve the right, in our sole discretion, to make changes or modifications to these Terms of Useat any time and for any reason. We will alert you about any changes by updating the Last updated date of these Terms of Use, and you waive any right to receive specific notice of each such change. Please ensure that you check the applicable Terms every time you use our Site so that you understand which Terms apply. You will be subject to, and will be deemed to have been made aware of and to have accepted, the changes in any revised Terms of Use by your continued use of the Site after the date such revised Terms of Use are posted.</p>\r\n<p></p>\r\n<p data-custom-class=\"body_text\">The information provided on the Site is not intended for distribution to or use by any person or entity in any jurisdiction or country where such distribution or use would be contrary to law or regulation or which would subject us to any registration requirement within such jurisdiction or country. Accordingly, those persons who choose to access the Site from other locations do so on their own initiative and are solely responsible for compliance with local laws, if and to the extent local laws are applicable.</p>\r\n<p></p>\r\n<p data-custom-class=\"body_text\">All users who are minors in the jurisdiction in which they reside (generally under the age of 18) must have the permission of, and be directly supervised by, their parent or guardian to use the Site. If you are a minor, you must have your parent or guardian read and agree to these Terms of Use prior to you using the Site.</p>\r\n<p></p>\r\n<p></p>\r\n<ol start=\"2\">\r\n<li data-custom-class=\"heading_1\"><strong>INTELLECTUAL PROPERTY RIGHTS</strong></li>\r\n</ol>\r\n<p></p>\r\n<p data-custom-class=\"body_text\">Unless otherwise indicated, the Site is our proprietary property and all source code, databases, functionality, software, website designs, audio, video, text, photographs, and graphics on the Site (collectively, the Content) and the trademarks, service marks, and logos contained therein (the Marks) are owned or controlled by us or licensed to us, and are protected by copyright and trademark laws and various other intellectual property rights and unfair competition laws of the United States, international copyright laws, and international conventions. The Content and the Marks are provided on the Site AS IS for your information and personal use only. Except as expressly provided in these Terms of Use, no part of the Site and no Content or Marks may be copied, reproduced, aggregated, republished, uploaded, posted, publicly displayed, encoded, translated, transmitted, distributed, sold, licensed, or otherwise exploited for any commercial purpose whatsoever, without our express prior written permission.</p>\r\n<p></p>\r\n<p data-custom-class=\"body_text\">Provided that you are eligible to use the Site, you are granted a limited license to access and use the Site and to download or print a copy of any portion of the Content to which you have properly gained access solely for your personal, non-commercial use. We reserve all rights not expressly granted to you in and to the Site, the Content and the Marks.</p>\r\n<p></p>\r\n<p></p>\r\n<ol start=\"3\">\r\n<li data-custom-class=\"heading_1\"><strong>USER REPRESENTATIONS</strong></li>\r\n</ol>\r\n<p></p>\r\n<p data-custom-class=\"body_text\">By using the Site, you represent and warrant that:(1) all registration information you submit will be true, accurate, current, and complete; (2) you will maintain the accuracy of such information and promptly update such registration information as necessary;(3) you have the legal capacity and you agree to comply with these Terms of Use;(4) you are not a minor in the jurisdiction in which you reside, or if a minor, you have received parental permission to use the Site; (5) you will not access the Site through automated or non-human means, whether through a bot, script, or otherwise; (6) you will not use the Site for any illegal or unauthorized purpose; and (7) your use of the Site will not violate any applicable law or regulation.</p>\r\n<p></p>\r\n<p data-custom-class=\"body_text\">If you provide any information that is untrue, inaccurate, not current, or incomplete, we have the right to suspend or terminate your account and refuse any and all current or future use of the Site (or any portion thereof).</p>\r\n<p></p>\r\n<p></p>\r\n<p></p>\r\n<ol start=\"4\">\r\n<li data-custom-class=\"heading_1\"><strong>USER REGISTRATION</strong></li>\r\n</ol>\r\n<p></p>\r\n<p data-custom-class=\"body_text\">You may be required to register with the Site. You agree to keep your password confidential and will be responsible for all use of your account and password. We reserve the right to remove, reclaim, or change a username you select if we determine, in our sole discretion, that such username is inappropriate, obscene, or otherwise objectionable.</p>\r\n<p></p>\r\n<p></p>\r\n<p></p>\r\n<ol start=\"5\">\r\n<li data-custom-class=\"heading_1\"><strong>PROHIBITED ACTIVITIES</strong></li>\r\n</ol>\r\n<p></p>\r\n<p data-custom-class=\"body_text\">You may not access or use the Site for any purpose other than that for which we make the Site available. The Site may not be used in connection with any commercial endeavors except those that are specifically endorsed or approved by us.</p>\r\n<p></p>\r\n<p data-custom-class=\"body_text\">As a user of the Site, you agree not to:</p>\r\n<ul>\r\n<li data-custom-class=\"body_text\">Systematically retrieve data or other content from the Site to create or compile, directly or indirectly, a collection, compilation, database, or directory without written permission from us.</li>\r\n<li data-custom-class=\"body_text\">Trick, defraud, or mislead us and other users, especially in any attempt to learn sensitive account information such as user passwords.</li>\r\n<li data-custom-class=\"body_text\">Circumvent, disable, or otherwise interfere with security-related features of the Site, including features that prevent or restrict the use or copying of any Content or enforce limitations on the use of the Site and/or the Content contained therein.</li>\r\n<li data-custom-class=\"body_text\">Disparage, tarnish, or otherwise harm, in our opinion, us and/or the Site.</li>\r\n<li data-custom-class=\"body_text\">Use any information obtained from the Site in order to harass, abuse, or harm another person.</li>\r\n<li data-custom-class=\"body_text\">Make improper use of our support services or submit false reports of abuse or misconduct.</li>\r\n<li data-custom-class=\"body_text\">Use the Site in a manner inconsistent with any applicable laws or regulations.</li>\r\n<li data-custom-class=\"body_text\">Engage in unauthorized framing of or linking to the Site.</li>\r\n<li data-custom-class=\"body_text\">Upload or transmit (or attempt to upload or to transmit) viruses, Trojan horses, or other material, including excessive use of capital letters and spamming (continuous posting of repetitive text), that interferes with any pa