INSERT INTO `jobs` VALUES (17,55,'Sales Manager(Access Control ,Fire Alaram, CCTV)','Hiring for Sales Manager(Access Control ,Fire Alaram, CCTV) \r\nProduct based company,Permanent position,20 years old company.\r\nNote : Immediate joiners required,Only Candidates.\r\nLocation: Bangalore.\r\nExp: 8 - 12 years. B2B & B2C Sales.\r\n* Should have Sales experience in - Access Control systems ,Fire Alaram, Visitor Management, CCTV and Time Attendance solutions.\r\n* Key Connects in PMCs, Consultants, & Architects to generate leads is a must.\r\n* Meet monthly, quarterly & annual financial booking and gross margin targets.\r\nShare me the profile to shivakumar@recrumart.com',NULL,NULL,101,17,22,0,NULL,3,80000,100000,1,NULL,1,119,3,1,2,2,'2023-11-30 00:00:00',4,2,0,0,NULL,'2023-06-13 06:50:52','2024-04-04 07:03:42','Recrumart India Karnataka Bengaluru Sales Manager(Access Control ,Fire Alaram, CCTV) Hiring for Sales Manager(Access Control ,Fire Alaram, CCTV) \r\nProduct based company,Permanent position,20 years old company.\r\nNote : Immediate joiners required,Only Candidates.\r\nLocation: Bangalore.\r\nExp: 8 - 12 years. B2B & B2C Sales.\r\n* Should have Sales experience in - Access Control systems ,Fire Alaram, Visitor Management, CCTV and Time Attendance solutions.\r\n* Key Connects in PMCs, Consultants, & Architects to generate leads is a must.\r\n* Meet monthly, quarterly & annual financial booking and gross margin targets.\r\nShare me the profile to shivakumar@recrumart.com Marketing Sales Experienced ProfessionalMonthly Sales & Business Development Full Time/Permanent First Shift (Day) Male Bachelors 10 Year','sales-manageraccess-control-fire-alaram-cctv-38',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(39,65,'Sr Interior Designer','Job description\r\nAs a senior interior designer in sales, your primary role will be to provide interior design services to clients while also actively participating in sales activities. You will work closely with clients to understand their requirements, create design concepts, and present proposals that align with their needs. Additionally, you will leverage your sales skills to promote and sell design services and products.\r\n\r\nResponsibilities:\r\n\r\nInterior Design:Collaborate with clients to determine their design preferences, functional requirements, and budgetary constraints.\r\nCreate design concepts, including space planning, material selection, color schemes, and furniture layout.\r\nDevelop detailed drawings, mood boards, and 3D visualizations to effectively communicate design ideas.\r\nSource and select furniture, fixtures, finishes, and accessories that meet the client\'s aesthetic and functional criteria.\r\nCoordinate with suppliers, contractors, and other professionals to ensure the successful execution of design projects.\r\nStay updated with the latest interior design trends, materials, and techniques.\r\n\r\nSales:Proactively engage with prospective clients to generate leads and promote interior design services.\r\nConduct client consultations to understand their needs and explain the value proposition of your design services.\r\nPrepare and present compelling proposals and quotations tailored to each client\'s requirements.\r\nEffectively communicate the benefits and features of design products and services to potential customers.\r\nNegotiate pricing, contracts, and timelines to secure design projects.\r\nBuild and maintain strong relationships with clients to ensure customer satisfaction and generate repeat business.\r\nCollaborate with the marketing team to develop promotional materials and participate in sales events or exhibitions.\r\n\r\nRequirements:\r\n\r\nBachelor\'s degree in Interior Design, Architecture, or a related field.\r\nProven experience as an interior designer, with a portfolio showcasing your design projects.\r\nStrong sales skills and a track record of meeting or exceeding sales targets.\r\nProficiency in design software such as AutoCAD, SketchUp, 3ds Max, or similar tools.\r\nExcellent communication and interpersonal skills to effectively interact with clients and stakeholders.\r\nStrong knowledge of interior design principles, materials, and construction techniques.\r\nAbility to multitask, prioritize workload, and manage time effectively.\r\nAttention to detail and a keen eye for aesthetics.\r\nKnowledge of local building codes, regulations, and industry standards.','PF. Incentives',NULL,101,17,24,0,NULL,3,35000,55000,0,NULL,1,53,3,1,NULL,15,'2023-11-30 00:00:00',4,4,1,0,NULL,'2023-07-06 09:59:57','2024-04-03 12:15:22','sudheer India Karnataka Bengaluru Sr Interior Designer Job description\r\nAs a senior interior designer in sales, your primary role will be to provide interior design services to clients while also actively participating in sales activities. You will work closely with clients to understand their requirements, create design concepts, and present proposals that align with their needs. Additionally, you will leverage your sales skills to promote and sell design services and products.\r\n\r\nResponsibilities:\r\n\r\nInterior Design:Collaborate with clients to determine their design preferences, functional requirements, and budgetary constraints.\r\nCreate design concepts, including space planning, material selection, color schemes, and furniture layout.\r\nDevelop detailed drawings, mood boards, and 3D visualizations to effectively communicate design ideas.\r\nSource and select furniture, fixtures, finishes, and accessories that meet the client\'s aesthetic and functional criteria.\r\nCoordinate with suppliers, contractors, and other professionals to ensure the successful execution of design projects.\r\nStay updated with the latest interior design trends, materials, and techniques.\r\n\r\nSales:Proactively engage with prospective clients to generate leads and promote interior design services.\r\nConduct client consultations to understand their needs and explain the value proposition of your design services.\r\nPrepare and present compelling proposals and quotations tailored to each client\'s requirements.\r\nEffectively communicate the benefits and features of design products and services to potential customers.\r\nNegotiate pricing, contracts, and timelines to secure design projects.\r\nBuild and maintain strong relationships with clients to ensure customer satisfaction and generate repeat business.\r\nCollaborate with the marketing team to develop promotional materials and participate in sales events or exhibitions.\r\n\r\nRequirements:\r\n\r\nBachelor\'s degree in Interior Design, Architecture, or a related field.\r\nProven experience as an interior designer, with a portfolio showcasing your design projects.\r\nStrong sales skills and a track record of meeting or exceeding sales targets.\r\nProficiency in design software such as AutoCAD, SketchUp, 3ds Max, or similar tools.\r\nExcellent communication and interpersonal skills to effectively interact with clients and stakeholders.\r\nStrong knowledge of interior design principles, materials, and construction techniques.\r\nAbility to multitask, prioritize workload, and manage time effectively.\r\nAttention to detail and a keen eye for aesthetics.\r\nKnowledge of local building codes, regulations, and industry standards. Communication Skills Experienced Professional 35000 55000Monthly Interior Designers & Architects Full Time/Permanent First Shift (Day) Both Genders Allowed Bachelors 3 Year','sr-interior-designer-39',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(40,67,'Windows System Adminstrator','Windows System Admin Openings \r\n\r\nExperience   : 4+ years \r\nSkills            : Windows server, Windows trouble shooting, Firewall, \r\nSalary           : Industry Standards\r\nLocation       : Whitefield, Bangalore\r\nImmediate joiners\r\n\r\nFor Walkin Interview \r\nContact : Girish \r\n+91-9343556688','ESI, PF',NULL,101,17,25,0,NULL,3,3,5,1,NULL,1,58,3,1,4,2,'2023-11-30 00:00:00',8,6,1,0,NULL,'2023-07-07 11:30:25